import '../bootstrap.css';
import '../App.css';
import logo from './img/logo-ilab.png';

const Navbar = () => {
  return (
    <section className="nav fixed-top">
      <div className="container">
        <div className="row nav-row">
          <div className="col-4 logo">
            <img src={logo} alt="logo-ilab.png" width="100px" height="50px" style={{ height: '39px' }} />
          </div>
          <div className="col-4 nav-menu">
            <a href="/">HOME</a>
            <a href="/about">ABOUT US</a>
            <a href="#">CONTACT</a>
          </div>
          <div className="col-4 nav-button">
            <button type="button" className="btn btn-primary btn-lg button-signup">SIGN UP</button>
            <button type="button" className="btn btn-primary btn-lg button-login">LOGIN</button>
          </div>
        </div>
      </div>
    </section>
  );
};
export default Navbar;
